import RootContext from "../../providers/root";
import './loading.css';
import React, { useContext} from 'react';

function Results() {
    const {
        setCurrentPage
    } = useContext(RootContext);
    
    return (
        <div className='container'>
           <div className="loader-container"><div class="loader"></div></div>
        </div>
    );
}

export default Loading;
